myApp.controllers={menuPage:function(o){Array.prototype.forEach.call(o.querySelectorAll('[component="button/refresh"]'),function(o){o.onclick=function(){location.reload()}}),Array.prototype.forEach.call(o.querySelectorAll('[component="button/new-todo"]'),function(o){o.onclick=function(){document.querySelector("#myNavigator").pushPage("include/new_todo.html")}})},newTodoPage:function(o){o.querySelector("#todo-date").innerHTML=getTime(),Array.prototype.forEach.call(o.querySelectorAll('[component="button/save-todo"]'),function(e){e.onclick=function(){var e=o.querySelector("#todo-description").value,t=o.querySelector("#todo-date").innerHTML;if(e&&t){var n={key:null,description:e,createDate:t,flag:!0};myApp.services.todos.create(n)}}}),Array.prototype.forEach.call(o.querySelectorAll('[component="button/save-todo-back"]'),function(o){o.onclick=function(){document.querySelector("#myNavigator").popPage()}})}};